  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Parker River
  National Wildlife Refuge outlines Refuge accomplishments from May through August
  of 1946. The report begins by summarizing the weather conditions, water conditions,
  wildfires, and food and cover during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, fur animals, predators, rodents, raptors,
  and fish- is also covered. The Refuge development and maintenance section discusses
  physical developments, plantings, and collections and receipts. Resource management
  is outlined; topics include grazing and haying. A progress report on field investigations
  and applied research is also provided. The public relations section of the report
  describes recreational uses, Refuge visitors, Refuge participation, and fishing.
  N-R forms  are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
